import React from 'react'

let style = {
    lineHeight: '5px',
    backgroundColor: 'rgba(0, 0, 0, .3)',
    innerPadding: '5px',
    height: '30px',
    display: 'inline-block'
}

let style2 = {
    lineHeight: '5px'
}

const feedItem = (props) => (
    <div style={style}>
        <h6>Plate #: {props.children}</h6>
        <h6>Car Type: {'Blue Honda Civic'}</h6>
    </div> 
)

export default feedItem
